/**
 * @class Vuex Store.
 */
class VueStoreFactory {
    /**
     * Loads in all store files.
     */
    static async load() {
        try {
            const {data, status} = await axios.get('_/vue/store');
            if (status !== 200) {
                VueApp.warn('Error retrieving store files.'
                    + ` Expected 200 response but got ${status}.`, data);
                return false;
            }
            const {store} = data;
            for (let file in store) {
                try {
                    eval(store[file]);
                } catch(e) {
                    VueApp.warn(`Error loading store file: ${file}`, e);
                }
            }
            return true;
        } catch(e) {
            VueApp.warn(`Could not load store endpoint.`, e);
        }
    }

    /**
     * Initializes Vuex store.
     */
    static initialize() {
        if (VueStoreFactory.instance) {
            return VueStoreFactory.instance;
        }

        // Create mutations if DNE.
        Object.keys(VueStoreFactory.state).map((key) => {
            if (!VueStoreFactory.mutations[key]) {
                VueStoreFactory.mutations[key] = function(state, value) {
                    state[key] = value;
                }
            }
        });

        VueStoreFactory.instance = new Vuex.Store({
            actions: VueStoreFactory.actions,
            getters: VueStoreFactory.getters,
            modules: VueStoreFactory.modules,
            mutations: VueStoreFactory.mutations,
            plugins: VueStoreFactory.plugins,
            state: VueStoreFactory.state,
        });

        VueStoreFactory.initialized(VueStoreFactory.instance);

        // Initialize Vuex store.
        return VueStoreFactory.instance;
    }
}

VueStoreFactory.onInitialized = (new Promise((resolve) => {
    VueStoreFactory.initialized = resolve;
}));

